INSERT INTO `movie` VALUES (1,'A Flying Jatt','Hindi','Action','02:31:00','UA','2D','https://www.youtube.com/embed/1J9Z0qhKZqo','http://www.media.glamsham.com/download/poster/images/a-flying-jatt/03-a-flying-jatt.jpg','2016-01-25','Tiger Shroff is a Flying Jatt whose aim is to save the world.','https://i.imgur.com/CG31oYL.jpg'),(2,'Akira','Hindi','Action','02:30:40','UA','2D','https://www.youtube.com/embed/QsCkty3mpg0','http://www.media.glamsham.com/download/poster/images/akira/04-akira.jpg','2016-01-02','Acclaimed director and producer A.R. Murugadoss delivers the action-drama Naam Hai Akira, a remake of the hit Tamil film Mouna Guru, powered by Sonakshi Sinha in the lead role.','http://www.wholereultss.com/wp-content/uploads/2016/08/Akira-Hindi-Movie-Review-And-Rating-Public-Talk-Story-1st-Day-Collections.jpg'),(3,'Happy Bhaag Jayegi','Hindi','Romance','02:06:00','U','2D','https://www.youtube.com/embed/9OXFk-pdi6c','http://www.media.glamsham.com/download/poster/images/happy-bhaag-jaayegi/02-happy-bhaag-jaayegi.jpg','2016-01-19','A girl decides to sprint out of her own wedding and has two countries chasing after her! Watch Happy jump borders and raise a storm!','http://quintype-01.imgix.net/thequint/2016-07/ecd7c67b-f85d-4770-a9e9-e5b7ed70c746/Happy%20Bhaag%20Jayegi.jpg'),(4,'Mohenjo Daro','Hindi','Drama','02:35:00','UA','2D','https://www.youtube.com/embed/UPZ5FKEB02I','http://www.media.glamsham.com/download/poster/images/mohnjo-daro/01-mohnjo-daro.jpg','2016-01-12','During the Pre-historic Indus Valley, in 2016 BC, the evil greed of a man is about to destroy one of the oldest cities in the ancient world, Mohenjo Daro. A young indigo farmer, Sarman, enters the city and meets Chaani, the daughter of the Priest, predicted to be the Origin of a New Society. Sarman, in his attempt to win Chaanis love, uncovers the secrets nobody was ever supposed to know - about Chaani, about Mohenjo Daro and about his own past!','http://www.lyricsmint.com/wp-content/uploads/2016/07/mohenjo-daro-cover.jpg'),(5,'Rustom','Hindi','Crime','02:31:00','UA','2D','https://www.youtube.com/embed/L83qMnbJ198','http://www.media.glamsham.com/download/poster/images/rustom/01-rustom.jpg','2016-01-12','A dashing naval officer, a beautiful wife and a perfect world. This was Naval Commander Rustom Pavri\'s life.\r\nUntil one day he realizes his perfect life isntwhat he thought it was. As events unfold we realize his wife is having an affair with his best friend. \r\nThree fatal shots change their lives.\r\nBased on true events, Rustom is a gripping tale about Pride, Passion and Power, and a man who must his uphold his own integrity and that of the nation.','http://www.thehansindia.com/assets/9983_Rustom.jpg'),(6,'Don\'t Breathe','English','Horror','01:31:00','A','2D','https://www.youtube.com/embed/76yBTNDB6vU','http://www.impawards.com/2016/posters/dont_breathe.jpg','2016-01-02','A group of friends break into the house of a wealthy blind man, thinking they`ll get away with the perfect heist. They`re wrong.','http://themovieblog.com/wp-content/uploads/2016/08/o2sbbEoKa.jpg'),(7,'Gravity','English','Sci-fi','02:00:00','UA','IMAX-3D','https://www.youtube.com/embed/OiTiKOy59o4','http://www.impawards.com/2013/posters/gravity.jpg','2013-01-04','Academy Award winners Sandra Bullock and George Clooney star in \'Gravity\' a heart-pounding thriller that pulls you into the infinite and unforgiving realm of deep space. The film has been directed by Oscar-nominee Alfonso Cuaron.\r\n\r\nBullock plays Dr. Ryan Stone a brilliant engineer on her first shuttle mission with veteran astronaut Matt Kowalski (Clooney). But on a seemingly routine spacewalk disaster strikes. The shuttle is destroyed leaving Stone and Kowalski completely alone-tethered to nothing but each other and spiraling out into the blackness.\r\n\r\nThe deafening silence tells them they have lost any link to Earth...and any chance for rescue. As fear turns to panic every gulp of air eats away at what little oxygen is left. \r\n\r\nBut the only way home may be to go further out into the terrifying expanse of space\r\n\r\n','http://s2.dmcdn.net/IuoxS.jpg'),(8,'Ice Age: Collision Course','English','Animation','01:35:00','U','3D','https://www.youtube.com/embed/Ohq6NmKMja8','http://www.impawards.com/2016/posters/ice_age_five_ver16.jpg','2016-01-22','Scrat`s epic pursuit of his elusive acorn catapults him outside of Earth, where he accidentally sets off a series of cosmic events that transform and threaten the planet. To save themselves from peril, Manny, Sid, Diego, and the rest of the herd leave their home and embark on a quest full of thrills and spills, highs and lows, laughter and adventure while traveling to exotic new lands and encountering a host of colorful new characters as well as a new enemy who is a brother to one of their old foes','http://dikamarmandi.in/wp-content/uploads/2016/08/ice-age-collision-course-dikamarmandiin.jpg'),(9,'Intersteller - IMAX','English','Sci-fi','02:50:00','UA','IMAX','https://www.youtube.com/embed/zSWdZVtXT7E','http://www.impawards.com/2014/posters/interstellar_ver2.jpg','2016-01-07','With our time on Earth coming to an end, a team of explorers undertakes the most important mission in human history: traveling beyond this galaxy to discover whether mankind has a future among the stars','http://www.interstellarmovie.net/images/downloads/wps/1920/int_wps_1920_farm.jpg'),(10,'Mechanic: Resurrection','English','Action','01:45:00','UA','2D','https://www.youtube.com/embed/QF903RaKLvs','http://www.impawards.com/2016/posters/mechanic_resurrection_ver2.jpg','2016-01-26','Arthur Bishop (Jason Statham) returns as the Mechanic in the sequel to the 2011 action thriller. When the deceitful actions of a cunning but beautiful woman (Jessica Alba) force him to return to the life he left behind, Bishops life is once again in danger as he has to complete an impossible list of assassinations of the most dangerous men in the world.','http://cdn-static.denofgeek.com/sites/denofgeek/files/2016/08/mechanic-resurrection-uk-release-date-set-for-august.jpg'),(11,'Kidaari','Tamil','Action','02:20:00','UA','2D','https://www.youtube.com/embed/li8AIW35FH0','http://livecinemanews.com/wp-content/uploads/2016/07/kidaari-movie-posters-hd.jpg','2016-01-02','Kidaari is set in Sattur and Sasikumar plays the title role, which here refers to a rough guy who has a short temper.','https://www.indupdates.in/wp-content/uploads/2016/08/Kidaari-Teaser.jpg'),(12,'Janatha Garage','Telugu','Drama','03:15:36','UA','2D','https://www.youtube.com/embed/7O4Hm070Bc8','http://ia.media-imdb.com/images/M/MV5BYWI3Y2RhNTQtNGE3Mi00ZDc2LTliMDItNTQyNmJiYTVlMzE2XkEyXkFqcGdeQXVyNjgyMTk2MTU@._V1_SX300.jpg','2016-01-02','This is the story of a garage called, \'Janatha Garage\' which was started by Mr. Mohan Lal in the 1980s. Gradually, in 25 years, the garage grows in its stature to represent people in need and against anything that is evil to the society. The hero, Mr. NTR, is an environmental studies student in Mumbai, who fights for a greener planet. Due to one of his projects, he happens to come to Hyderabad.\r\n\r\nMeanwhile, Mr. Lal grows into a larger than life figure who has an impact on the whole state. Due to an unforeseen situation caused by a businessman who wants to get rid of Janatha Garage, he meets with an accident which will hamper the actions of the garage.\r\n\r\nThe rest of the story revolves around how the hero upon knowing about the past, associates himself with the garage. This helps him to defeat all the evil elements in the society.','http://www.thehansindia.com/assets/6885_Janatha%20Garage.jpg'),(13,'Darra','Punjabi','Drama','02:02:00','UA','2D','https://www.youtube.com/embed/8-W6d-X9mMs',' http://ia.media-imdb.com/images/M/MV5BOTQ1N2EzMzMtYmFkMi00MDE4LTliODUtODA5NDQwMmJlY2JkXkEyXkFqcGdeQXVyNDU0Mzg1NTg@._V1_.jpg','2016-01-02','The story of the film revolves around the realistic issues of Punjab. It is about three brothers living in a village, where local politics snatches away their harmony and amity.','http://www.thenewsrecorder.com/wp-content/uploads/2016/09/dara-punjabi-film-star-cast-wiki-release-dates.jpg'),(14,'Shaheb Bibi Golaam','Bengali','Drama','02:00:00','A','2D','https://www.youtube.com/embed/73xET43OpPA','https://in.bmscdn.com/events/Large/ET00043572.jpg','2016-01-26','Jimmy, a middle-aged Anglo-Indian man, is trying to do good by breaking bad. Jaya, a middle-class Hindu housewife, goes into forbidden territory to challenge the life she has been hurled into. Javed is a Muslim taxi driver who gets into a relationship he doesn\'t fully understand. Their different worlds collide in a winter afternoon in Kolkata in this fast-paced thriller.','https://upload.wikimedia.org/wikipedia/en/e/e6/Saheb_Bibi_Gollam.jpg'),(15,'Satrangi','Haryanvi','Family','01:57:00','U','2D','https://www.youtube.com/embed/6WLQPSxj_h0','https://upload.wikimedia.org/wikipedia/en/9/9d/Satrangi_Re.jpg','2016-01-26','Satrangi is about the beautiful relationship that is shared by a father and daughter. It has won the National award for the best Haryanvi film.','http://images.jdmagicbox.com/movies/mumbai_10718781122016_08_24_02_31_48.jpg'),(16,'Raaz Reboot','Hindi','Horror','02:08:00','A','2D','https://www.youtube.com/embed/V496LGfxr38','http://www.media.glamsham.com/download/poster/images/raaz-reboot/05-raaz-reboot.jpg','2016-09-19','Raaz Reboot is a horror film that revolves around a married couple living in Romania. Shaina and Rehaan begin to hide something from each other...','https://i.ytimg.com/vi/U1rWRv1X08g/maxresdefault.jpg'),(17,'Bridget Jones\'s Baby','English','Comedy','01:50:00','A','2D','https://www.youtube.com/embed/mJsvmscPY9w','http://www.impawards.com/intl/uk/2016/posters/bridget_joness_baby.jpg','2016-09-19','With two men (Colin Firth, Patrick Dempsey) in her life, a pregnant Bridget Jones (Rene Zellweger) must figure out who\'s the father of her baby.','http://www.hellomagazine.com/imagenes//film/2016062332059/official-bridget-jones-baby-posters-released-mark-darcy/0-159-156/bridget-t.jpg'),(18,'The Shallows','English','Thriller','01:20:00','UA','3D','https://www.youtube.com/embed/vPOpE-_42as','http://www.impawards.com/2016/posters/shallows.jpg','2016-09-19','In the taut thriller The Shallows, Nancy, who is surfing on a secluded beach, finds herself on the feeding ground of a great white shark. Though she is stranded only 200 yards from shore, survival proves to be the ultimate test of wills, requiring all of Nancy`s ingenuity, resourcefulness, and fortitude','http://horrornews.net/wp-content/uploads/2016/06/ts1.jpg'),(19,'Baar Baar Dekho','Hindi','Drama','02:21:00','UA','2D','https://www.youtube.com/embed/Wiuj_GHlb64','http://www.media.glamsham.com/download/poster/images/baar-baar-dekho/01-baar-baar-dekho.jpg','2016-09-19','What would you do if you could see the future of your relationship? Jump on this roller coaster ride with Jai and Diya as they ride the ups and down of their relationship through the test of time.','https://i.ytimg.com/vi/Wiuj_GHlb64/maxresdefault.jpg');
